        const response = axios.get("http://localhost:8080/test", {
          headers: {
            ACCESS_TOKEN: `${accessToken}`,
          },
        });
        console.log(response);
      })
      .catch(async (error) => {
        const refreshResponse = await axios.get(
          "http://localhost:8080/api/v1/jwt/refresh"
        );
        const accessToken = await refreshResponse.headers.accessToken;
        const refreshToken = await refreshResponse.headers.refreshToken;
        const response = axios.get("http://localhost:8080/test", {
          headers: {
            ACCESS_TOKEN: `${accessToken}`,
          },
        });
        console.log(response);
      });
  };
  return (
    <>
      <input type="text" placeholder="..." />
      <button onClick={handleClick}>click</button>
    </>
  );
};

export default Test;
